import React from 'react';
import axios from 'axios';

import styles from '../Main.module.css';
import taskStyles from './Task1.module.css';

class Task1 extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
          isFetching: false
        };
      }

    render() {
        const fetchBlock = (this.state.isFetching) ?
            <div className={styles.loadingPane}> Fetching... </div>
            :null;

        const mainTask =
            <div>
                <div className={taskStyles.inputFormDiv}>
                    <form>
                        <input type='number' id='alphaStep' />
                        <input type='number' id='count' />
                        <input type='number' id='spread' />
                        <input type='submit' value='Generate' />
                    </form>
                </div>
            </div>

        return (
            <main>
               {fetchBlock}
               {mainTask}
            </main>
        )}
}

export default Task1;
